import React from 'react';
import Logo from './Logo';
import Menu from './Menu';


function TopPage() {
    const menuItems = [
        {name: "Home", url: "index.html" },
        {name: "Drink", url: "#"},
        {name: "Sweets", url: "#"},
        {name: "Food", url: "#"},
        {name: "Contact", url: "#"}
    ];


    return (
        <>
        <Logo /><Menu items={menuItems} /></>

    );  
}

export default TopPage;
